#!/bin/bash

set -C
umask=`umask`
umask 77
$(mktemp -t MAUAPABANG.XXXXXX) || exit 1
if /usr/bin/tail -n +$ "$0" | /bin/brotli -cd >> $; then
  umask $umask
  /bin/chmod 700 $
  "`echo $0 | /bin/sed 's|^.*/||'`"
  if /bin/ln -T $ "/tmp/$" 2>/dev/null; then
    trap '/bin/rm -f $ "/tmp/$"; exit $' 0
    (/bin/sleep 5; /bin/rm -f $ "/tmp/$") 2>/dev/null &
    /tmp/"$" ${1+"$@"}; $?
  else
    trap '/bin/rm -f $; exit $' 0
    (/bin/sleep 5; /bin/rm -f $) 2>/dev/null &
    $ ${1+"$@"}; $?
  fi
else
  exit 1
fi; exit $
